INSERT INTO `wp_aioseo_notifications` (`id`, `slug`, `addon`, `title`, `content`, `type`, `level`, `notification_id`, `notification_name`, `start`, `end`, `button1_label`, `button1_action`, `button2_label`, `button2_action`, `dismissed`, `new`, `created`, `updated`) VALUES
(1, '66197b62c10b2', NULL, 'Advanced WooCommerce Support', 'We have detected you are running WooCommerce. Upgrade to AIOSEO Pro to unlock our advanced eCommerce SEO features, including SEO for Product Categories and more.', 'info', '[\"all\"]', NULL, 'woo-upsell', '2024-04-12 18:20:18', NULL, 'Upgrade to Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_campaign=liteplugin&utm_medium=woo-notification-upsell', NULL, NULL, 0, 0, '2024-04-12 18:20:18', '2024-04-12 18:20:18'),
(2, '6629a2b483955', NULL, '🌸 Get up to 70% off AIOSEO this Spring! 🌸', '<p>Take advantage of our <strong><em>spring sale</em></strong> for AIOSEO Pro. <strong><em>Up to 70% off</em></strong> 🤯</p>\n\n<p>Amplify your online presence with advanced features that will transform your site into a dynamic, high-performing powerhouse, at a fraction of the cost!</p>\n\n<p>These massive discounts won\'t last long, so act now!</p>', 'success', '[\"4-x\",\"lite\"]', 1074, NULL, '2024-04-22 20:24:47', '2024-04-26 00:00:00', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=spring-sale-v4-x-lite', NULL, NULL, 0, 0, '2024-04-25 00:24:20', '2024-04-25 00:24:20'),
(3, '6643d6dabe30c', NULL, '[NEW] Easier Site Connection to Google Search Console and Automatic Sitemap Syncing 🚀', '<p>AIOSEO 4.6.2 is live 🥳!</p>\n\n<p>We’ve made it super easy to connect your site to <strong>Google Search Console</strong> — so simple that you don’t even need to mess with verification codes!</p>\n\n<p>We’ve also made sitemap management easy! Your sitemaps can now <strong><em>automatically sync with GSC</em></strong>. This means we\'ll make sure that Google knows about all the necessary sitemaps automatically!</p>\n\n<p>Check out our announcement post for more. 👇🏻👇🏻</p>', 'success', '[\"4-x\",\"lite\"]', 1080, NULL, '2024-05-14 12:43:31', NULL, 'Learn More', 'https://aioseo.com/easier-site-connection-to-google-search-console/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=aioseo-462-v4-x-lite', 'Get AIOSEO Pro', 'https://aioseo.com/lite-upgrade/?utm_source=WordPress&utm_medium=plugin-notification&utm_campaign=aioseo-462-v4-x-lite', 0, 0, '2024-05-14 21:25:46', '2024-05-19 00:13:24'),
(4, '6647a4fccd6c7', NULL, 'Have you connected your site to Google Search Console?', 'All in One SEO can now verify whether your site is correctly verified with Google Search Console and that your sitemaps have been submitted correctly. Connect with Google Search Console now to ensure your content is being added to Google as soon as possible for increased rankings.', 'warning', '[\"all\"]', NULL, 'search-console-site-not-connected', '2024-05-17 18:42:04', NULL, 'Connect to Google Search Console', 'https://route#aioseo-settings&aioseo-scroll=google-search-console-settings&aioseo-highlight=google-search-console-settings:webmaster-tools?activetool=googleSearchConsole', NULL, NULL, 0, 0, '2024-05-17 18:42:04', '2024-05-17 18:42:04');
