(427, 'monsterinsights_notifications', 'a:4:{s:6:\"update\";i:1715971023;s:4:\"feed\";a:2:{i:0;a:7:{s:5:\"title\";s:102:\"[New in MonsterInsights 8.25] Display your stats on any page or post with the new Site Insights block!\";s:7:\"content\";s:321:\"Want to show off your stats in a post or page on your website? Upgrade now for access to the new MonsterInsights Site Insights block! Display your sessions, average visit duration, top countries, and more right on your website with our handy new block. You can even customize your traffic graphs with your brand\'s colors.\";s:4:\"type\";a:1:{i:0;s:4:\"lite\";}s:2:\"id\";i:216;s:4:\"btns\";a:2:{s:4:\"main\";a:2:{s:3:\"url\";s:103:\"https://www.monsterinsights.com/lite?utm_medium=plugin&utm_source=liteplugin&utm_campaign=notifications\";s:4:\"text\";s:22:\"Upgrade Now - Save 50%\";}s:3:\"alt\";a:2:{s:3:\"url\";s:178:\"https://www.monsterinsights.com/introducing-the-monsterinsights-site-insights-block-display-your-stats-anywhere?utm_medium=plugin&utm_source=liteplugin&utm_campaign=notifications\";s:4:\"text\";s:10:\"Learn More\";}}s:5:\"start\";s:19:\"2024-03-13 00:00:00\";s:3:\"end\";s:19:\"2024-09-13 00:00:00\";}i:1;a:7:{s:5:\"title\";s:51:\"[NEW MonsterInsights 8.24 ] - Privacy Guard Feature\";s:7:\"content\";s:203:\"MonsterInsights 8.24 Pro includes Privacy Guard, our brand new feature to help keep Personally Identifiable Information (PII) outside of Google Analytics. Upgrade now to instasntly activate and save 50%!\";s:4:\"type\";a:1:{i:0;s:4:\"lite\";}s:2:\"id\";i:210;s:4:\"btns\";a:2:{s:4:\"main\";a:2:{s:3:\"url\";s:113:\"https://www.monsterinsights.com/lite?utm_source=liteplugin&utm_medium=notification&utm_campaign=8_24_announcement\";s:4:\"text\";s:11:\"Upgrade Now\";}s:3:\"alt\";a:2:{s:3:\"url\";s:177:\"https://www.monsterinsights.com/introducing-privacy-guard-keep-personal-info-out-of-google-analytics?utm_source=liteplugin&utm_medium=notification&utm_campaign=8_24_announcement\";s:4:\"text\";s:10:\"Learn More\";}}s:5:\"start\";s:19:\"2024-02-23 00:00:00\";s:3:\"end\";s:19:\"2024-07-22 00:00:00\";}}s:6:\"events\";a:12:{i:0;a:10:{s:2:\"id\";s:59:\"monsterinsights_notification_install_user_feedback_20240517\";s:4:\"icon\";s:9:\"lightning\";s:5:\"title\";s:36:\"What Are Your Users Really Thinking?\";s:7:\"content\";s:255:\"MonsterInsights tells you WHAT your website visitors are doing on your website, but our latest plugin, UserFeedback, tells you WHY. Use its short surveys to make more money, increase engagement, and grow your business faster with candid customer feedback.\";s:4:\"type\";a:5:{i:0;s:5:\"basic\";i:1;s:4:\"lite\";i:2;s:6:\"master\";i:3;s:4:\"plus\";i:4;s:3:\"pro\";}s:4:\"btns\";a:1:{s:25:\"cta_install_user_feedback\";a:2:{s:3:\"url\";s:73:\"https://blog.webskills.in/wp-admin/admin.php?page=userfeedback_onboarding\";s:4:\"text\";s:18:\"Install & Activate\";}}s:5:\"start\";s:18:\"05/17/2024 6:41 pm\";s:3:\"end\";s:10:\"06/14/2024\";s:8:\"category\";s:7:\"insight\";s:8:\"priority\";i:1;}i:1;a:10:{s:2:\"id\";s:62:\"monsterinsights_notification_to_setup_affiliate_links_20240517\";s:4:\"icon\";s:7:\"default\";s:5:\"title\";s:30:\"Set Up Affiliate Link Tracking\";s:7:\"content\";s:557:\"By tracking your affiliate links in Google Analytics, you can gather all the data you need to optimize your links for maximizing affiliate revenue. You can track affiliate link clicks on your website with little configuration needed.<br><br><a href=\"https://www.monsterinsights.com/how-to-set-up-affiliate-link-tracking-in-wordpress/?utm_source=liteplugin&utm_medium=monsterinsights-notifications-sidebar&utm_campaign=notifications&utm_content=8.26.0\" target=\"_blank\">In this article</a>, we’ll show you how to set up affiliate link tracking in WordPress.\";s:4:\"type\";a:5:{i:0;s:5:\"basic\";i:1;s:4:\"lite\";i:2;s:6:\"master\";i:3;s:4:\"plus\";i:4;s:3:\"pro\";}s:4:\"btns\";a:1:{s:9:\"read_more\";a:3:{s:3:\"url\";s:200:\"https://www.monsterinsights.com/how-to-set-up-affiliate-link-tracking-in-wordpress/?utm_source=liteplugin&utm_medium=monsterinsights-notifications-sidebar&utm_campaign=notifications&utm_content=8.26.0\";s:4:\"text\";s:9:\"Read More\";s:11:\"is_external\";b:1;}}s:5:\"start\";s:18:\"05/17/2024 6:45 pm\";s:3:\"end\";s:10:\"06/09/2024\";s:8:\"category\";s:7:\"insight\";s:8:\"priority\";i:2;}i:2;a:10:{s:2:\"id\";s:65:\"monsterinsights_notification_to_add_more_file_extensions_20240517\";s:4:\"icon\";s:7:\"default\";s:5:\"title\";s:28:\"Track Your Website Downloads\";s:7:\"content\";s:806:\"By default, MonsterInsights automatically tracks downloads of the following file extensions: doc, pdf, ppt, zip, xls, docx, pptx, and xlsx. You can easily add or remove extensions from that list in the <a href=\"https://blog.webskills.in/wp-admin/admin.php?page=monsterinsights_settings&monsterinsights-scroll=monsterinsights-settings-block-file-downloads&monsterinsights-highlight=monsterinsights-settings-block-file-downloads#/engagement\">Engagement settings</a> of MonsterInsights.<br><br> You can view your Top Downloads report directly in the MonsterInsights <a href=\"https://blog.webskills.in/wp-admin/admin.php?page=monsterinsights_reports&monsterinsights-scroll=monsterinsights-report-download-links&monsterinsights-highlight=monsterinsights-report-download-links#/publishers\">Publishers report</a>.\";s:4:\"type\";a:5:{i:0;s:5:\"basic\";i:1;s:4:\"lite\";i:2;s:6:\"master\";i:3;s:4:\"plus\";i:4;s:3:\"pro\";}s:4:\"btns\";a:1:{s:24:\"add_more_file_extensions\";a:2:{s:3:\"url\";s:227:\"https://blog.webskills.in/wp-admin/admin.php?page=monsterinsights_settings&monsterinsights-scroll=monsterinsights-settings-block-file-downloads&monsterinsights-highlight=monsterinsights-settings-block-file-downloads#/engagement\";s:4:\"text\";s:19:\"Add File Extensions\";}}s:5:\"start\";s:18:\"05/17/2024 6:45 pm\";s:3:\"end\";s:10:\"06/04/2024\";s:8:\"category\";s:7:\"insight\";s:8:\"priority\";i:2;}i:3;a:10:{s:2:\"id\";s:56:\"monsterinsights_notification_returning_visitors_202