(17, 1, '2023-09-13 10:25:27', '2023-09-13 10:25:27', '<!-- wp:paragraph {\"align\":\"center\",\"style\":{\"color\":{\"gradient\":\"linear-gradient(126deg,rgb(14,52,79) 0%,rgb(120,0,112) 50%,rgb(65,88,208) 100%)\"}},\"textColor\":\"white\"} -->\n<p class=\"has-text-align-center has-white-color has-text-color has-background\" style=\"background:linear-gradient(126deg,rgb(14,52,79) 0%,rgb(120,0,112) 50%,rgb(65,88,208) 100%)\"> <em><strong>BELIEVE IN US, YOUR SUCCESS IS OUR PRIORITY! </strong><br></em>Proactively deploy cutting-edge platforms that align with integrated pathways. Pioneering top-tier solutions while upholding industry-standard interfaces. Consistently enhance client experiences.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\",\"textColor\":\"white\",\"gradient\":\"midnight\"} -->\n<p class=\"has-text-align-center has-white-color has-midnight-gradient-background has-text-color has-background\"><em><strong>In Need of Expert Advice?</strong><br></em>Delve deep into expertise that only we offer. Benefit from unparalleled insights and strategies that make a difference.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\",\"style\":{\"color\":{\"gradient\":\"linear-gradient(90deg,rgb(6,147,227) 0%,rgb(14,14,14) 52%,rgb(155,81,224) 100%)\"}},\"textColor\":\"white\"} -->\n<p class=\"has-text-align-center has-white-color has-text-color has-background\" style=\"background:linear-gradient(90deg,rgb(6,147,227) 0%,rgb(14,14,14) 52%,rgb(155,81,224) 100%)\"><em><strong>Aiming to Boost Your Revenue?</strong><br></em>Discover avenues to increase your financial growth. Our proven tactics guarantee a leap in your profit margins.</p>\n<!-- /wp:paragraph -->', 'About Us', '', 'publish', 'closed', 'closed', '', 'about-us', '', '', '2023-09-13 10:25:27', '2023-09-13 10:25:27', '', 0, 'https://wpfrank.com/demo/marin/?page_id=17', 0, 'page', '', 0),
